import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import {
  Modal,
  Popover,
  Tooltip,
  Button,
  OverlayTrigger,
} from 'react-bootstrap';
class TsModal extends React.Component {

  render() {
    return (
      	<Modal show={this.props.show} onHide={this.props.onhide}>
          <Modal.Header closeButton>
          <Modal.Title>Book Tables</Modal.Title>
          </Modal.Header>
          <Modal.Body>            
            <hr />

            <Button id = { {time} + 'p1'} bsStyle="primary" bsSize="small" href = {'http://localhost:4000/?id=' + id} >Pool table 1</Button>
            <Button id = { {time} + 'p1'} bsStyle="primary" bsSize="small" href = 'http://localhost:4000/'>Pool table 2</Button>
            <Button id = { {time} + 'p1'} bsStyle="primary" bsSize="small" href = 'http://localhost:4000/'>Snooker table 1</Button>
            <Button id = { {time} + 'p1'} bsStyle="primary" bsSize="small" href = 'http://localhost:4000/'>Snooker table 2</Button>
            <Button id = { {time} + 'p1'} bsStyle="primary" bsSize="small" href = 'http://localhost:4000/'>Snooker table 3</Button>

          </Modal.Body>
          <Modal.Footer>
            <Button onClick={this.props.onclick}>Close</Button>
          </Modal.Footer>
        </Modal>
    );
  }
}

export default TsModal;
